import React, { useState } from 'react';
import axios from 'axios';
import '../App.css';

function RegistrationPage() {
  const [firstname, setFirstName] = useState('');
  const [lastname, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [dob, setBirthDate] = useState('');
  const [password, setPassword] = useState('');
  const [registrationSuccess, setRegistrationSuccess] = useState(false);

  const handleRegistration = async () => {
    try {
      const userData = {
        firstname,
        lastname,
        email,
        dob,
        password
      };

      const response = await axios.post('http://localhost:9090/api/v1/customer/add', userData);
      console.log('User registered:', response.data);

    } catch (error) {
      console.error('Registration error:', error);
    }
    setRegistrationSuccess(true);
  };

  if (registrationSuccess) {
    return (
      <div className="moodmate-container success-container">
        <div className="moodmate-card">
          <div className="success-icon">
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
              <path d="M22 11.08V12a10 10 0 1 1-5.93-9.14"></path>
              <polyline points="22 4 12 14.01 9 11.01"></polyline>
            </svg>
          </div>
          <h1 className="moodmate-title">Registration Successful!</h1>
          <p className="moodmate-subtitle">Your MoodMate journal account has been created</p>
          <div className="moodmate-action">
            <a href="/" className="moodmate-button primary">Login to your account</a>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="moodmate-container">
      <div className="moodmate-card">
        <div className="moodmate-header">
          <h1 className="moodmate-logo">MoodMate Journal</h1>
          <p className="moodmate-tagline">Begin your emotional wellness journey</p>
        </div>
        
        <h2 className="moodmate-form-title">Create Account</h2>
        
        <div className="moodmate-form">
          <div className="moodmate-input-group">
            <div className="moodmate-input-row">
              <div className="moodmate-input-container half">
                <label htmlFor="firstname" className="moodmate-label">First Name</label>
                <input 
                  type="text" 
                  id="firstname"
                  className="moodmate-input" 
                  value={firstname} 
                  onChange={(e) => setFirstName(e.target.value)} 
                  placeholder="Enter your first name" 
                />
              </div>
              <div className="moodmate-input-container half">
                <label htmlFor="lastname" className="moodmate-label">Last Name</label>
                <input 
                  type="text" 
                  id="lastname"
                  className="moodmate-input" 
                  value={lastname} 
                  onChange={(e) => setLastName(e.target.value)} 
                  placeholder="Enter your last name" 
                />
              </div>
            </div>
            
            <div className="moodmate-input-container">
              <label htmlFor="email" className="moodmate-label">Email Address</label>
              <input 
                type="email" 
                id="email"
                className="moodmate-input" 
                value={email} 
                onChange={(e) => setEmail(e.target.value)} 
                placeholder="your.email@example.com" 
              />
            </div>
            
            <div className="moodmate-input-container">
              <label htmlFor="password" className="moodmate-label">Password</label>
              <input 
                type="password" 
                id="password"
                className="moodmate-input" 
                value={password} 
                onChange={(e) => setPassword(e.target.value)} 
                placeholder="Create a secure password" 
              />
            </div>
            
            <div className="moodmate-input-container">
              <label htmlFor="dob" className="moodmate-label">Date of Birth</label>
              <input 
                type="date" 
                id="dob"
                className="moodmate-input" 
                value={dob} 
                onChange={(e) => setBirthDate(e.target.value)} 
              />
            </div>
          </div>
          
          <button className="moodmate-button primary full" onClick={handleRegistration}>
            Create Account
          </button>
          
          <div className="moodmate-divider">
            <span>Already have an account?</span>
          </div>
          
          <a href="/" className="moodmate-button secondary full">
            Sign In
          </a>
        </div>
        
        <p className="moodmate-footer">
          By creating an account, you agree to our <a href="#">Terms</a> and <a href="#">Privacy Policy</a>
        </p>
      </div>
    </div>
  );
}

export default RegistrationPage;
